import styled from 'styled-components';
export const HeaderWrap=styled.div`
	position:relative;
	top:0px;
	left:50%;
	margin-left:-50%;
	width:100%;
	height:60px;
	background-color:#f0f0f0;
	border-bottom:1px solid #eee;
`
export const HeaderImg=styled.div`
	position:absolute;
	top:0px;
	left:0px;
	margin-left:-50%;
	width:100%;
	height:60px;
	background-color:#f0f0f0;
	border-bottom:1px solid #eee;
`
